def count_nested_parens(s: str) -> int:
    """ Input to this function is a string of nested parentheses.
    Output the deepest level of nesting of parentheses.

    >>> count_nested_parens('(()()) ((())) () ((())()())')
    3
    """
    n = 0
    for c in s:
        if c == '(':
            n += 1
        elif c == ')':
            n -= 1
        if n < 0:
            return 0
    return n

