def part1(input_data: List[str]) -> int:
    gamma_rate = ""
    for i in range(len(input_data[0])):
        count = 0
        for string in input_data:
            if string[i] == "1":
                count += 1
        gamma_rate += "1" if count > (len(input_data) - count) else "0"
    epsilon_rate = "".join([str(1 - int(i)) for i in gamma_rate])
    return int(gamma_rate, 2) * int(epsilon_rate, 2)


def part2(input_data: List[str]) -> int:
    oxygen = input_data.copy()
    for i in range(len(input_data[0])):
        count = 0
        for string in oxygen:
            if string[i] == "1":
                count += 1
        if count >= len(oxygen) - count:
            oxygen = [string for string in oxygen if string[i] == "1"]
        else:
            oxygen = [string for string in oxygen if string[i] == "0"]
        if len(oxygen) == 1:
            break
    co2 = input_data.copy()
    for i in range(len(input_data[0])):
        count = 0
        for string in co2:
            if string[i] == "1":
                count += 1
        if count >= len(co2) - count:
            co2 = [string for string in co2 if string[i] == "0"]
        else:
            co2 = [string for string in co2 if string[i] == "1"]
        if len(co2) == 1:
            break
    return int(oxygen[0], 2) * int(co2[0], 2)


