    'abba'
    >>> longest_palindrome('aaabbb')
    'aaa'
    """
    longest = ''
    for i in range(len(string)):
        for j in range(i, len(string)):
            if is_palindrome(string[i:j+1]):
                if len(string[i:j+1]) > len(longest):
                    longest = string[i:j+1]
    return longest

