def strstartswith(string: str, prefix: str) -> bool:
    """ Return True if string starts with prefix, else False
    >>> strstartswith('abc', 'ab')
    True
    >>> strstartswith('abc', 'a')
    False
    """
    for i in range(len(prefix)):
        if string[i] != prefix[i]:
            return False
    return True

def strendswith(string: str, suffix: str) -> bool:
    """ Return True if string ends with suffix, else False
    >>> strendswith('abc', 'bc')
    True
    >>> strendswith('abc', 'a')
    False
    """
    for i in range(len(suffix)):
        if string[len(string) - len(suffix) + i] != suffix[i]:
            return False
    return True

def strfind(string: str, sub: str) -> int:
    """ Return index of first occurrence of sub in string, else -1
    >>> strfind('abc', 'b')
    1
    >>> strfind('abc', 'd')
    -1
    """
    for i in range(len(string)):
        if string[i] == sub[0]:
            for j in range(len(sub)):
                if string[i+j] != sub[j]:
                    break
                if j == len(sub) - 1:
                    return i
    return -1

def strrfind(string: str, sub: str) -> int:
    """ Return index of last occurrence of sub in string, else -1
    >>> strrfind('abc', 'b')
    1
    >>> strrfind('abc', 'd')
    -1
    """
    for i in range(len(string), 0, -1):
        if string[i] == sub[0]:
            for j in range(len(sub)):
                if string[i+j] != sub[j]:
                    break
                if j == len(sub) - 1:
                    return i
    return -1

def strcount(string: str, sub: str) -> int:
    """ Return number of occurrences of sub in string
    >>> strcount('abc', 'b')
    1
    >>> strcount('abc', 'a')
    1
    >>> strcount('abc', 'c')
    1
    >>> strcount('abc', 'd')
    0
    """
    count = 0
    for i in range(len(string)):
        if string[i] == sub[0]:
            for j in range(len(sub)):
                if string[i+j] != sub[j]:
                    break
                if j == len(sub) - 1:
                    count += 1
                    break
    return count

def strreplace(string: str, old: str, new: str) -> str:
    """ Return string with all occurrences of old replaced by new
    >>> strreplace('abc', 'b', 'd')
    'adc'
    >>> strreplace('abc', 'a', 'd')
    'dbc'
    >>> strreplace('abc', 'c', 'd')
    'abd'
    """
    result = ''
    for i in range(len(string)):
        if string[i] == old[0]:
            for j in range(len(old)):
                if string[i+j] != old[j]:
                    break
                if j == len(old) - 1:
                    result += new
                    break
            else:
                result += string[i]
        else:
            result += string[i]
    return result

