def prime_fib_list(n: int):
    """
    prime_fib_list returns a list of n first numbers that are Fibonacci numbers and it's also prime.
    >>> prime_fib_list(5)
    [2, 3, 5, 13, 89]
    """
    if n < 1:
        return None
    result = []
    p = 1
    while len(result) < n:
        if is_prime(p):
            if is_fib(p):
                result.append(p)
        p += 1
    return result

