def merge(l1: list, l2: list) -> list:
    """Merge two sorted lists into a single sorted list.
    >>> l1 = [1, 3, 5, 7]
    >>> l2 = [2, 4, 6, 8]
    >>> merge(l1, l2)
    [1, 2, 3, 4, 5, 6, 7, 8]
    """
    result = []
    i, j = 0, 0
    while i < len(l1) and j < len(l2):
        if l1[i] < l2[j]:
            result.append(l1[i])
            i += 1
        else:
            result.append(l2[j])
            j += 1
    result += l1[i:]
    result += l2[j:]
    return result


