def insertion_sort(l: list) -> list:
    """Sort the elements of the list l using insertion sort.
    """
    for i in range(1, len(l)):
        j = i - 1
        while j >= 0 and l[j] > l[j + 1]:
            l[j], l[j + 1] = l[j + 1], l[j]
            j -= 1
    return l


