def quicksort(l: list) -> list:
    """Sort the elements of the list l using quicksort.
    """
    if len(l) <= 1:
        return l
    else:
        pivot = l[0]
        left = [x for x in l if x < pivot]
        right = [x for x in l if x > pivot]
        return quicksort(left) + [pivot] + quicksort(right)


