def selection_sort(l: list) -> list:
    """Sort the elements of the list l using selection sort.
    """
    for i in range(len(l)):
        min_index = i
        for j in range(i + 1, len(l)):
            if l[j] < l[min_index]:
                min_index = j
        l[i], l[min_index] = l[min_index], l[i]
    return l


