def bubblesort(l: list) -> list:
    """Sort the elements of the list l using bubblesort.
    """
    for i in range(len(l)):
        for j in range(len(l) - 1, i, -1):
            if l[j] < l[j - 1]:
                l[j], l[j - 1] = l[j - 1], l[j]
    return l


