def is_palindrome_recursive(text: str, start: int = 0, end: int = 0):
    """
    Checks if given string is a palindrome
    >>> is_palindrome_recursive('')
    True
    >>> is_palindrome_recursive('aba')
    True
    >>> is_palindrome_recursive('aaaaa')
    True
    >>> is_palindrome_recursive('zbcd')
    False
    """
    if end == len(text) - 1:
        return text[start:end + 1] == text[start:end + 1][::-1]
    else:
        return is_palindrome_recursive(text, start, end + 1)


