def is_palindromic_number(number: int) -> bool:
    """
    Checks if given number is a palindromic number
    >>> is_palindromic_number(121)
    True
    >>> is_palindromic_number(-121)
    False
    >>> is_palindromic_number(10)
    False
    """
    if number < 0:
        return False
    else:
        return str(number) == str(number)[::-1]

