    >>> modp(3, 5)
    3
    >>> modp(1101, 101)
    2
    >>> modp(0, 101)
    1
    >>> modp(3, 11)
    8
    >>> modp(100, 101)
    1
    """
    if n < 0:
        return -modp(-n, p)
    if n == 0:
        return 1
    if n == 1:
        return n % p
    if n % 2 == 0:
        return modp2(n // 2, p) ** 2 % p
    return modp2(n // 2, p) ** 2 * n % p

