    """Return the number of vowels and consonants in word."""
    vowels = ['a', 'e', 'i', 'o', 'u']
    consonants = []
    for char in word:
        if char in vowels:
            vowels.append(char)
        else:
            consonants.append(char)
    return len(vowels), len(consonants)

