def max_fill_helper(grid, capacity, bucket_level, bucket_count):
    # Base case: all wells are empty
    if all(all(row) == [] for row in grid):
        return bucket_count

    # Get the next well to fill
    next_well = get_next_well(grid)
    next_well_bucket_level = bucket_level + next_well[1]
    next_well_bucket_count = bucket_count + 1

    # If the bucket is full, refill it
    if next_well_bucket_level > capacity:
        next_well_bucket_level = 0

    # If the bucket is empty, skip this well
    if next_well_bucket_level == 0:
        return max_fill_helper(grid, capacity, bucket_level, bucket_count)

    # Fill the bucket
    grid[next_well[0]][next_well[1]] = 0
    bucket_level = next_well_bucket_level

    # Recursively fill the remaining wells
    return max_fill_helper(grid, capacity, bucket_level, next_well_bucket_count)

def get_next_well(grid):
    # Find the first well with water
    for row in range(len(grid)):
        for col in range(len(grid[row])):
            if grid[row][col] == 1:
                return row, col

    # If no wells have water, return None
    return None

    return max_fill_recursive(grid, capacity, 0, 0) if grid else 0

def max_fill_recursive(grid, capacity, i, j):
    if i == len(grid) or j == len(grid[0]):
        return 0
    if grid[i][j] == 1:
        if capacity == 0:
            return 1 + max_fill_recursive(grid, capacity, i + 1, j)
        else:
            return 1 + max_fill_recursive(grid, capacity - 1, i + 1, j)
    else:
        return max_fill_recursive(grid, capacity, i + 1, j)

def max_fill_iterative(grid, capacity):
    if not grid:
        return 0
    rows, cols = len(grid), len(grid[0])
    dp = [[0] * cols for _ in range(rows)]
    for i in range(rows):
        for j in range(cols):
            dp[i][j] = 1 if grid[i][j] == 1 else 0
    for row in range(rows):
        for col in range(cols):
            if dp[row][col] == 1:
                if capacity == 0:
                    dp[row][col] = 1 + dp[row + 1][col]
                else:
                    dp[row][col] = 1 + dp[row + 1][col] if dp[row + 1][col] != 0 else 0
    return dp[0][0]

