def find_path(grid, row, col, k):
    if k == 0:
        return True
    if row < 0 or row >= len(grid) or col < 0 or col >= len(grid[0]):
        return False
    if grid[row][col] > k:
        return False
    grid[row][col] = 0
    if find_path(grid, row + 1, col, k - grid[row][col]) or \
       find_path(grid, row - 1, col, k - grid[row][col]) or \
       find_path(grid, row, col + 1, k - grid[row][col]) or \
       find_path(grid, row, col - 1, k - grid[row][col]):
        return True
    grid[row][col] = k
    return False

def dfs(grid, row, col, k):
    if k == 0:
        return [row, col]
    if row < 0 or row >= len(grid) or col < 0 or col >= len(grid[0]):
        return []
    if grid[row][col] > k:
        return []
    grid[row][col] = 0
    for dr, dc in [(1, 0), (0, 1), (-1, 0), (0, -1)]:
        path = dfs(grid, row + dr, col + dc, k - grid[row][col])
        if path:
            return [row, col] + path
    grid[row][col] = k
    return []

def backtrack(grid, row, col, k):
    if k == 0:
        return [row, col]
    if row < 0 or row >= len(grid) or col < 0 or col >= len(grid[0]):
        return []
    if grid[row][col] > k:
        return []
    grid[row][col] = 0
    for dr, dc in [(1, 0), (0, 1), (-1, 0), (0, -1)]:
        path = backtrack(grid, row + dr, col + dc, k - grid[row][col])
        if path:
            return [row, col] + path
    grid[row][col] = k
    return []

