# argument n and returns True if n is a prime number and False
# otherwise. You can use the following code to test your function.
def is_prime(n):
    """This function checks if a number is prime or not.

    """
    if n < 2:
        return False
    for x in range(2, n):
        if n % x == 0:
            return False
    return True


