\end{blockquote}

This is not a good way to solve this problem. The `in` operator is a linear time operation. You are running it `len(b)` times. This is a quadratic time operation. You can do it in linear time with a single pass.

\begin{code}
def cycpattern_check(a, b):
    for i in range(len(a) - len(b) + 1):
        if a[i:i+len(b)] == b:
            return True
    return False
