def letter_count_sort(s):
    """Given a string, return a list of the letters in the string, sorted by the number of times the letter appears in the string, with the most common letter first.

    Example:
        letter_count_sort("hello") ==> ["l", "l", "h", "e", "o"]
        letter_count_sort("aaabbb") ==> ["a", "b", "b", "b", "a", "a"]
    """
    letter_dict = {}
    for letter in s:
        if letter in letter_dict:
            letter_dict[letter] += 1
        else:
            letter_dict[letter] = 1

    sorted_dict = sorted(letter_dict.items(), key=lambda x: x[1], reverse=True)
    return [item[0] for item in sorted_dict]

