# 5. Write a function that takes a list of integers and returns the sum of all positive numbers in the list.
def sum_positive_numbers(numbers):
    """
    Given a list of integers 'numbers', return the sum of all positive numbers in the list.
    If 'numbers' is an empty list, return None.

    >>> sum_positive_numbers([1, 2, 3, 4, 5]) == 15
    """
    if not numbers:
        return None
    return sum([num for num in numbers if num > 0])

# 6. Write a function that takes a list of integers and returns the product of all positive numbers in the list.
def product_positive_numbers(numbers):
    """
    Given a list of integers 'numbers', return the product of all positive numbers in the list.
    If 'numbers' is an empty list, return None.

    >>> product_positive_numbers([1, 2, 3, 4, 5]) == 120
    """
    if not numbers:
        return None
    return reduce(lambda x, y: x * y, [num for num in numbers if num > 0])

# 7. Write a function that takes a list of integers and returns the sum of all even numbers in the list.
def sum_even_numbers(numbers):
    """
    Given a list of integers 'numbers', return the sum of all even numbers in the list.
    If 'numbers' is an empty list, return None.

    >>> sum_even_numbers([2, 4, 6, 8, 10]) == 30
    """
    if not numbers:
        return None
    return sum([num for num in numbers if num % 2 == 0])

# 8. Write a function that takes a list of integers and returns the product of all odd numbers in the list.
def product_odd_numbers(numbers):
    """
    Given a list of integers 'numbers', return the product of all odd numbers in the list.
    If 'numbers' is an empty list, return None.

    >>> product_odd_numbers([1, 3, 5, 7, 9]) == 945
    """
    if not numbers:
        return None
    return reduce(lambda x, y: x * y, [num for num in numbers if num % 2 != 0])

# 9. Write a function that takes a list of integers and returns the sum of all numbers in the list that are divisible by 3.
def sum_divisible_by_three(numbers):
    """
    Given a list of integers 'numbers', return the sum of all numbers in the list that are divisible by 3.
    If 'numbers' is an empty list, return None.

    >>> sum_divisible_by_three([3, 6, 9, 12, 15]) == 45
    """
    if not numbers:
        return None
    return sum([num for num in numbers if num % 3 == 0])

# 10. Write a function that takes a list of integers and returns the product of all numbers in the list that are divisible by 5.
def product_divisible_by_five(numbers):
    """
    Given a list of integers 'numbers', return the product of all numbers in the list that are divisible by 5.
    If 'numbers' is an empty list, return None.

    >>> product_divisible_by_five([5, 10, 15, 20, 25]) == 125000
    """
    if not numbers:
        return None
    return reduce(lambda x, y: x * y, [num for num in numbers if num % 5 == 0])

