def sum_divisible_by_three_or_five(numbers):
    """
    Given a list of integers 'numbers', return the sum of all numbers in the list that are divisible by 3 or 5.
    If 'numbers' is an empty list, return None.

    >>> sum_divisible_by_three_or_five([3, 6, 9, 12, 15, 18, 21, 24, 27, 30]) == 120
    """
    if not numbers:
        return None
    return sum([num for num in numbers if num % 3 == 0 or num % 5 == 0])

